import React from 'react';
import { Element } from 'react-scroll';
import KKW from '../KKW/KKW';
function Work() {
	return (
		<Element name="work">
			<div className="container">
				<div className="row">
					<div className="col-12">
						<div className="d-flex justify-content-center">
							<KKW />
						</div>
					</div>
				</div>
			</div>
		</Element>
	);
}

export default Work;
